from collections import deque

def oranges_rotting(grid):
    n = len(grid)
    fresh_oranges = 0
    rotten_oranges = deque()

    for i in range(n):
        for j in range(n):
            if grid[i][j] == 1:
                fresh_oranges += 1
            elif grid[i][j] == 2:
                rotten_oranges.append((i, j))

    minutes = 0
    directions = [(0, 1), (0, -1), (1, 0), (-1, 0)]

    while fresh_oranges > 0 and rotten_oranges:
        minutes += 1
        newly_rotten = deque()
        while rotten_oranges:
            row, col = rotten_oranges.popleft()

            for dr, dc in directions:
                new_row, new_col = row + dr, col + dc

                if 0 <= new_row < n and 0 <= new_col < n and grid[new_row][new_col] == 1:
                    grid[new_row][new_col] = 2
                    fresh_oranges -= 1
                    newly_rotten.append((new_row, new_col))
        rotten_oranges.extend(newly_rotten)

    if fresh_oranges > 0:
        return -1
    else:
        return minutes
